import './App.css';
import "bootstrap/dist/css/bootstrap.min.css"
import WaitingRoom from './components/WaitingRoom';
import {Container, Row, Col} from "react-bootstrap"
function App() {
  return (
    <div >
      <main>
        <Container>
          <Row>
            <Col>
              <h1>
                Welcome its Talk Time!!
              </h1>
            </Col>
          </Row>
        </Container>

      </main>
    </div>
  );
}

export default App;
